import React from "react";
import Producto from "./Producto.js";


const App = () =>{

  const productos=[
    {id:1, nombre:"Cartera", precio:"40000"},
    {id:2, nombre:"Cartera", precio:"40000"},
    {id:3, nombre:"Cartera", precio:"40000"},
    {id:4, nombre:"Cartera", precio:"40000"},
    {id:5, nombre:"Cartera", precio:"40000"},
    {id:6, nombre:"Cartera", precio:"40000"},

  ];

  const renderProducts=()=>{
    return productos.map(t=><Producto producto={t}></Producto>);
  }
  return(<div>
    <div className="row">
      <div className="col-md-8">
        <h3>lo primero</h3>
        <p>por aca</p>

      </div>
      <div className="col-md-4">
        <h3>a la derecha </h3>
        <p>Todo esto</p>
      </div>
    </div>
    <div className="row producto">
      {renderProducts()}
    </div>
    </div>
    );
}

export default App;
